    /******menu*************/
    .dropdown {
      position: relative;

    .dropdown-content {
      display: none;
      position: absolute;
      background-color: #f9f9f9;
      width: 1350px; /* Установите желаемую ширину контейнера */
      text-align: left; /* Выравнивание по левому краю */
      margin-left: -350px; /* Сдвигаем контейнер влево на половину его ширины */
      left: 50%; /* Позиционируем контейнер по центру */
      z-index: 1;
      height: 1000px; /* Высота полосы */
    }

    .dropdown:hover .dropdown-content {
      display: block;
    }
    .vertical-line {
      border-left: 1px solid black;
      height: 100px; /* Высота полосы */
      position: absolute;
      top: 0; /* Положение полосы по верхнему краю */
    }
    /* Отступы между вертикальными полосами */
    .vertical-line:not(:last-child) {
      margin-right: 10px;
    }
    /* Треугольник сверху */
    .vertical-line::before {
      content: '';
      border-bottom: 10px solid black; /* Изменение только здесь: border-bottom вместо border-top */
      border-left: 10px solid transparent;
      border-right: 10px solid transparent;
      position: absolute;
      top: -10px; /* Расположение треугольника сверху */
      left: 50%; /* Положение по горизонтали */
      transform: translateX(-50%) rotate(180deg); /* Поворот на 180 градусов */
    }

    /* Треугольник снизу */
    .vertical-line::after {
      content: '';
      border-top: 10px solid black; /* Изменение только здесь: border-top вместо border-bottom */
      border-left: 10px solid transparent;
      border-right: 10px solid transparent;
      position: absolute;
      bottom: -10px; /* Расположение треугольника снизу */
      left: 50%; /* Положение по горизонтали */  transform: translateX(-50%) rotate(180deg); /* Поворот на 180 градусов */
    }

    .modal {
      display: none;
      position: fixed;
      z-index: 9999;
      left: 0;
      top: 0;
      width: 100%;
      height: 100%;
      overflow: auto;

    }

    .modal-content {
      background-color: black;
      color: white;
      margin: 15% auto;
      padding: 20px;
      border: 1px solid #888;

    .modal-content ul li {
      border-bottom: 1px solid #000; /* Горизонтальная граница между каждым элементом списка */

      margin-bottom: 4px; /* Отступ между каждым элементом списка */
      display: flex; /* Используем Flexbox */
      justify-content: space-between;
    }
    .modal-content ul li::after {
      content: ""; /* Создаем пустой псевдоэлемент */
      display: block; /* Делаем его блочным элементом */
      border-bottom: 1px solid #000; /* Горизонтальная граница */
      margin-left: 5px; /* Отступ слева от границы */
      width: calc(100% - 50px); /* Ширина границы, учитывая длину текста "Киев:" */
    }

    .modal-content ul {
      list-style-type: none; /* Убираем круги впереди текста */
